import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, TextInput, Button, View } from 'react-native';

let Register = () => {
  return (
    <View style={styles.container}>
        <TextInput style={styles.text} placeholder="Login"/>
        <TextInput secureTextEntry={true} style={styles.text} placeholder="Password"/>
        <TextInput style={styles.text} placeholder="Email"/>
        <TextInput style={styles.text} placeholder="Phone"/>
        <TextInput style={styles.text} placeholder="Age"/>
        <Button title="Register" color="#333333"/>
        
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',

  },
  text: {
      borderBottomColor: 'black',
      borderBottomWidth: 2,
      borderStyle: 'solid',
      width: 200,
      marginVertical: 5,
      color: 'white',
      fontSize: 15,
      marginVertical: 10,
  },
});

export default Register;
